    near-term future distribution of these species.  Current distribution was derived
    from LANDFIRE EVT v1.1, NatureServe National Landcover v2.7, Early Season Invasives
    (USGS), Predicted Tamarisk Probability (USGS), and mapped areas of tamarisk.  Predicted
